// client-portal/dashboard-tecnico/dashboard-tecnico.component.ts
import { Component } from '@angular/core';

@Component({
  selector: 'app-dashboard-tecnico',
  templateUrl: './dashboard-tecnico.component.html',
  styleUrls: ['./dashboard-tecnico.component.scss']
})
export class DashboardTecnicoComponent {}
<!-- client-portal/dashboard-tecnico/dashboard-tecnico.component.html -->
<app-navbar [rol]="'tecnico'"></app-navbar>

<section class="tecnico-dashboard">
  <h2>Panel Técnico</h2>
  <p>Gestiona tus citas y disponibilidad.</p>

  <ul>
    <li><a routerLink="/tecnico/citas">Citas asignadas</a></li>
    <li><a routerLink="/tecnico/diagnostico">Actualizar diagnóstico</a></li>
    <li><a routerLink="/tecnico/disponibilidad">Disponibilidad</a></li>
  </ul>
</section>
